                let CubesIntersection = Intersect(Cubes[0], Cubes[j]);

                if (UnpackCube(Cubes, j, CubesIntersection)) Overlappings = true;
                if (UnpackCube(Cubes, 0, CubesIntersection)) Overlappings = true;

